import React from "react";

const ContactForm = () =>{

    return(
        <form>
            <div className="form_div">
            <input type="text" name="" placeholder="Your Name*" required className="name"/>
            <input type="email" name="" placeholder="Email Address*" required  className="email"/>

            </div>

            <input type="text" name="" placeholder="Subject*" required className="subject"/> <br/>
            <textarea type="text" name="" placeholder="Message*" required  className="message"/> <br/>

            <div className="btn1">
            <button data-aos="zoom-in-up">Send Now <i className="fa-solid fa-paper-plane"></i></button>
            </div>
        </form>

    )
}

export default ContactForm;
